import React, {Component} from 'react';
import Form from './Form';
import Listavideos from './Listavideos';
import Api from '../api/Api.js'


class Page1 extends Component {
	constructor(props){
		super(props);
		this.state={
		    videos:[] ,
		    selectedVideos:null,
		}
   }
  onVideoSelect = (video )=>{
    this.setState({selectedVideos:this.state.video});
    
  }
  handleSubmit= async(termobusca) =>{
    const resposta= await Api.get('search', {
    params:{
      part:'snippet',
      maxResults:15,
      key:'AIzaSyCP8lufKgfTZ7tDE1gkRkaf4_DCyFXJ32o',
      q:termobusca
  }} );
    this.setState({videos: resposta.data.items, selectedVideos: resposta.data.items[0]});
    console.log(this.state.selectedVideos)
  }
	render(){
		return(
			<div>
				<Form className="App" render={(routeProps)=> <Form {...routeProps} onFormSubmit={this.handleSubmit}/> } />
				<Listavideos videos={this.state.videos} onVideoSelect={this.onVideoSelect} />
			</div>


			)
	}
}
export default Page1;
